  a Directional Waverider Buoy off Waimea Bay, North Shore, Oahu during December 2001
  - July 2004 (NODC Accession 0001626)\",\n\t\"tracking_summary\": {\n\t\t\"total\":
  2,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-12-20T18:47:30.226515\",\n\t\"name\": \"data-from-a-directional-waverider-buoy-off-waimea-bay-north-shore-oahu-during-december-2001-ju\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Through various funding channels, the Department
  of Oceanography at the University of Hawaii (UH) has maintained a Datawell Directional
  Waverider Buoy roughly 5 km northwest of Waimea Bay, Oahu in roughly 200 m ocean
  depth since 9 December, 2001. The buoy is a 0.9 m metallic floating sphere with
  a combination of a bungee and chain anchoring system. The long-term availability
  of this mooring is uncertain. The directional waverider measures the horizontal
  and vertical components of acceleration of the buoy, which rides up and down with
  the waves as it floats on the surface. The sampling rate is 1 Hz and the acquisition
  time is 20 minutes. From the accelerations of each acquisition time, spectra of
  energy by frequency and direction are derived. In addition, significant wave height
  and dominant wave period are calculated. The information is relayed to a shore data
  logging platform every 30 minutes. The Coastal Data Information Program (CDIP) are
  the primary stewards of the real-time data while UH handles maintenance duties.\",\n\t\"license_title\":
